        if(progress>100){ setProgress((progress) => progress + 1);}
       const interval = setInterval(() => {
           }, 100);
       
                   
        }, [progress]);



    return (
        <Subgrid>
            <div class="circular">
            <div class="inner"></div>
            <div class="outer"></div>
            <div class="numb">
               {progress}%
            </div>
            <div class="circle">
               <div class="dot">
                  <span></span>
               </div>
               <div class="bar left">
                  <div class="progress"></div>
               </div>
               <div class="bar right">
                  <div class="progress"></div>
               </div>
            </div>


           </div>
            <SuperSubgrid>
                <div>{props.state}</div>
                <div>{props.customer}</div>
                <div>{props.description}</div>

                </SuperSubgrid>
        </Subgrid>
       
    )
}

export default Component
